import React from "react";

export default function AIIFACTA() {
  return (
    <section className="aiifa-cta-section text-center">
      <div className="container">
        <div className="aiifa-cta-content d-flex justify-content-between align-items-center flex-wrap">
          <h2 className="aiifa-cta-title mb-3 mb-md-0">
            ALL INDIA INDUCTION FURNACES ASSOCIATION
          </h2>
          <button className="aiifa-cta-btn">GET A QUOTE</button>
        </div>
      </div>
    </section>
  );
}
